import SHOP_DATA from './shop.data.js'
import '../../components/CollectionPreview/collection-preview'

export default class ShopPage extends Component {
  constructor(props) {
    super(props)
    this.state = {
       collections: SHOP_DATA
    }
  }


  render(){
    return (
      <div>SHOP PAGE</div>
    )
  }
}
